import "./App.css";
import Navbar from "./Navbar";
import Socials from "./Socials";
import About from "./About";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="container mt-3 d-flex justify-content-around">
        <Socials />
        <About />
      </div>
    </div>
  );
}

export default App;
